import React, { Component } from "react";
import { connect } from "react-redux";
import * as system from "../actions/system";

class Dialog extends Component {
  constructor() {
    super();
    this.state = {
      isShow: false,
      isSubmitting: false
    };
  }

  submitForm() {
    this.setState({ isSubmitting: true });
    // conosole.log(this.state);
  }

  render() {
    return (
      <div>
        {this.props.models.isOpen ? (
          <div className="my-model" style={{ textAlign: "center" }}>
            <div className="modal-content card">
              {!this.state.isSubmitting ? (
                <div>
                  <h4>Create Memeber</h4>
                  <div>
                    <input placeholder="email" />
                  </div>
                  <div className="modal-footer">
                    <button
                      onClick={() => this.submitForm()}
                      className="modal-close waves-effect waves-green btn-flat"
                    >
                      Agree
                    </button>
                    <button
                      onClick={() => this.props.setModelType()}
                      className="modal-close waves-effect waves-green btn-flat"
                    >
                      disAgree
                    </button>
                  </div>
                </div>
              ) : (
                <div>
                  {" "}
                  refs number 466449
                  <button
                    onClick={() => this.props.setModelType()}
                    className="modal-close waves-effect waves-green btn-flat"
                  >
                    disAgree
                  </button>
                </div>
              )}
            </div>
          </div>
        ) : null}
      </div>
    );
  }
}

function mapDispatchToProps(dispatch) {
  return {
    setModelType: data => dispatch(system.setModelType(data))
  };
}

function mapStateToProps(state) {
  return {
    models: state.models
  };
}

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Dialog);
